  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:29.418226\",\n\t\"name\": \"seney-national-wildlife-refuge-annual-narrative-report-calendar-year-1999\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seney
  NWR and Huron Islands NWR outlines activities and accomplishments during the 1999
  calendar year. The report begins with an introduction to the Refuge. Highlights
  and weather conditions are summarized for the year. Information about monitoring
  and studies- including surveys and censuses and studies and investigations- is provided
  next. Habitat restoration and management projects are also covered; activities include
  wetland restoration, riverine restoration, water level management, grazing/mowing/haying,
  forest management, fire management, and vegetation control. Fish and wildlife management
  are discussed next with emphasis on bird banding, reintroductions, nest structures,
  and animal control. Coordination activities, such as interagency coordination, private
  land activities, and cooperative organizations, are outlined. The resource protection
  section provides an update on law enforcement, contaminants, cultural resource management,
  and land acquisition support. Information about public education and recreation
  is given including visitor services and outreach. Finally, general administration
  is discussed in the Refuge planning and administration section.\",\n\t\"license_title\":
